import React from 'react';
import {
  ScatterChart,
  Scatter,
  BarChart,
  Bar,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  ResponsiveContainer,
  Cell,
} from 'recharts';
import './Charts.css';

const Charts = ({ songs }) => {
  // Prepare data for charts
  const danceabilityData = songs.map((song, index) => ({
    index: index + 1,
    danceability: song.danceability,
    title: song.title,
  }));

  // Duration histogram (group into bins)
  const durationBins = [0, 120000, 180000, 240000, 300000, 360000, 500000];
  const durationLabels = ['0-2m', '2-3m', '3-4m', '4-5m', '5-6m', '6m+'];
  const durationData = durationLabels.map((label, index) => {
    const min = durationBins[index];
    const max = durationBins[index + 1] || Infinity;
    const count = songs.filter(s => s.duration_ms >= min && s.duration_ms < max).length;
    return { label, count };
  });

  // Acoustics data
  const acousticsData = songs
    .filter(song => song.acousticness != null)
    .slice(0, 20)
    .map((song, index) => ({
      name: song.title.substring(0, 15) + (song.title.length > 15 ? '...' : ''),
      value: song.acousticness || 0,
    }));

  // Tempo data
  const tempoData = songs
    .slice(0, 20)
    .map((song) => ({
      name: song.title.substring(0, 15) + (song.title.length > 15 ? '...' : ''),
      value: Math.round(song.tempo),
    }));

  const CustomTooltip = ({ active, payload }) => {
    if (active && payload && payload.length) {
      return (
        <div className="custom-tooltip glass-card">
          {payload.map((entry, index) => (
            <div key={index}>
              <p className="tooltip-label">{entry.payload.title || entry.payload.name}</p>
              <p className="tooltip-value">
                {entry.name}: {typeof entry.value === 'number' ? entry.value.toFixed(3) : entry.value}
              </p>
            </div>
          ))}
        </div>
      );
    }
    return null;
  };

  const COLORS = ['#1DB954', '#1ed760', '#43e97b', '#38f9d7', '#4facfe', '#00f2fe'];

  return (
    <div className="charts-container">
      <div className="charts-grid">
        {/* Danceability Scatter Chart */}
        <div className="chart-card glass-card">
          <h3 className="chart-title">
            <span className="chart-icon">üìä</span>
            Danceability Distribution
          </h3>
          <ResponsiveContainer width="100%" height={300}>
            <ScatterChart margin={{ top: 20, right: 20, bottom: 20, left: 20 }}>
              <CartesianGrid strokeDasharray="3 3" stroke="rgba(255,255,255,0.1)" />
              <XAxis
                type="number"
                dataKey="index"
                name="Song"
                stroke="#b3b3b3"
                tick={{ fill: '#b3b3b3' }}
              />
              <YAxis
                type="number"
                dataKey="danceability"
                name="Danceability"
                stroke="#b3b3b3"
                tick={{ fill: '#b3b3b3' }}
                domain={[0, 1]}
              />
              <Tooltip content={<CustomTooltip />} />
              <Scatter data={danceabilityData} fill="#1DB954">
                {danceabilityData.map((entry, index) => (
                  <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
                ))}
              </Scatter>
            </ScatterChart>
          </ResponsiveContainer>
        </div>

        {/* Duration Histogram */}
        <div className="chart-card glass-card">
          <h3 className="chart-title">
            <span className="chart-icon">‚è±Ô∏è</span>
            Song Duration Distribution
          </h3>
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={durationData} margin={{ top: 20, right: 20, bottom: 20, left: 20 }}>
              <CartesianGrid strokeDasharray="3 3" stroke="rgba(255,255,255,0.1)" />
              <XAxis dataKey="label" stroke="#b3b3b3" tick={{ fill: '#b3b3b3' }} />
              <YAxis stroke="#b3b3b3" tick={{ fill: '#b3b3b3' }} />
              <Tooltip
                contentStyle={{
                  background: 'rgba(40, 40, 40, 0.95)',
                  border: '1px solid rgba(255,255,255,0.1)',
                  borderRadius: '8px',
                  color: 'white',
                }}
              />
              <Bar dataKey="count" radius={[8, 8, 0, 0]}>
                {durationData.map((entry, index) => (
                  <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
                ))}
              </Bar>
            </BarChart>
          </ResponsiveContainer>
        </div>

        {/* Acoustics Bar Chart */}
        <div className="chart-card glass-card">
          <h3 className="chart-title">
            <span className="chart-icon">üé∏</span>
            Acousticness (Top 20 Songs)
          </h3>
          <ResponsiveContainer width="100%" height={300}>
            <BarChart
              data={acousticsData}
              layout="vertical"
              margin={{ top: 20, right: 20, bottom: 20, left: 80 }}
            >
              <CartesianGrid strokeDasharray="3 3" stroke="rgba(255,255,255,0.1)" />
              <XAxis type="number" stroke="#b3b3b3" tick={{ fill: '#b3b3b3' }} domain={[0, 1]} />
              <YAxis
                type="category"
                dataKey="name"
                stroke="#b3b3b3"
                tick={{ fill: '#b3b3b3', fontSize: 12 }}
              />
              <Tooltip
                contentStyle={{
                  background: 'rgba(40, 40, 40, 0.95)',
                  border: '1px solid rgba(255,255,255,0.1)',
                  borderRadius: '8px',
                  color: 'white',
                }}
              />
              <Bar dataKey="value" fill="#667eea" radius={[0, 8, 8, 0]} />
            </BarChart>
          </ResponsiveContainer>
        </div>

        {/* Tempo Bar Chart */}
        <div className="chart-card glass-card">
          <h3 className="chart-title">
            <span className="chart-icon">üéµ</span>
            Tempo (Top 20 Songs)
          </h3>
          <ResponsiveContainer width="100%" height={300}>
            <BarChart
              data={tempoData}
              layout="vertical"
              margin={{ top: 20, right: 20, bottom: 20, left: 80 }}
            >
              <CartesianGrid strokeDasharray="3 3" stroke="rgba(255,255,255,0.1)" />
              <XAxis type="number" stroke="#b3b3b3" tick={{ fill: '#b3b3b3' }} />
              <YAxis
                type="category"
                dataKey="name"
                stroke="#b3b3b3"
                tick={{ fill: '#b3b3b3', fontSize: 12 }}
              />
              <Tooltip
                contentStyle={{
                  background: 'rgba(40, 40, 40, 0.95)',
                  border: '1px solid rgba(255,255,255,0.1)',
                  borderRadius: '8px',
                  color: 'white',
                }}
              />
              <Bar dataKey="value" fill="#f093fb" radius={[0, 8, 8, 0]} />
            </BarChart>
          </ResponsiveContainer>
        </div>
      </div>
    </div>
  );
};

export default Charts;
